import React, { useState } from "react";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  Tooltip,
  Legend,
  ResponsiveContainer,
} from "recharts";

const routeQuarterlyData = {
  "SEA-JFK": [
    { quarter: "Q1", waste: 4400 },
    { quarter: "Q2", waste: 3900 },
    { quarter: "Q3", waste: 3500 },
    { quarter: "Q4", waste: 3100 },
  ],
  "ATL-PHX": [
    { quarter: "Q1", waste: 4600 },
    { quarter: "Q2", waste: 4100 },
    { quarter: "Q3", waste: 3600 },
    { quarter: "Q4", waste: 3200 },
  ],
  "LAX-SFO": [
    { quarter: "Q1", waste: 4000 },
    { quarter: "Q2", waste: 3600 },
    { quarter: "Q3", waste: 3300 },
    { quarter: "Q4", waste: 3000 },
  ],
};

const routeQuarterlyInsights = {
  "SEA-JFK": {
    Q1: {
      untouched: ["Fruit Bowl", "Chicken Curry"],
      eaten: ["Rice", "Paneer Wrap"],
      summary: "Focus on reducing Fruit Bowl portions on SEA-JFK in Q1.",
    },
    Q2: {
      untouched: ["Yogurt", "Croissant"],
      eaten: ["Veg Omelette", "Sausage"],
      summary: "Croissant is frequently untouched. Recommend substituting it.",
    },
    Q3: {
      untouched: ["Salad", "Bread Roll"],
      eaten: ["Soup", "Grilled Chicken"],
      summary: "Grilled Chicken is preferred. Salad often wasted in Q3.",
    },
    Q4: {
      untouched: ["Tofu Stir Fry"],
      eaten: ["Pasta", "Apple Pie"],
      summary: "Tofu Stir Fry is consistently untouched. Consider replacing.",
    },
  },
  "ATL-PHX": {
    Q1: {
      untouched: ["Eggplant Roll", "Fruit Cup"],
      eaten: ["Burger", "Chips"],
      summary: "Eggplant Roll is not preferred by ATL-PHX flyers.",
    },
    Q2: {
      untouched: ["Tomato Soup"],
      eaten: ["Bagel", "Bacon"],
      summary: "Soup shows lower consumption. Consider alternate starter.",
    },
    Q3: {
      untouched: ["Muffin"],
      eaten: ["Omelet", "Hash Browns"],
      summary: "Omelet popularity high. Optimize quantity accordingly.",
    },
    Q4: {
      untouched: ["Quinoa Bowl"],
      eaten: ["Lasagna", "Brownie"],
      summary: "Quinoa Bowl consistently untouched. Replace with carb-rich option.",
    },
  },
  "LAX-SFO": {
    Q1: {
      untouched: ["Salmon", "Peas"],
      eaten: ["Beef Burrito", "Mashed Potatoes"],
      summary: "Peas are unpopular. Favor mashed or seasoned vegetables.",
    },
    Q2: {
      untouched: ["Parfait"],
      eaten: ["Chicken Wrap", "Oreo Pie"],
      summary: "Chicken Wrap well received. Consider expanding options.",
    },
    Q3: {
      untouched: ["Boiled Eggs"],
      eaten: ["Toast", "Smoothie"],
      summary: "Boiled Eggs low pickup. Toast-based options better.",
    },
    Q4: {
      untouched: ["Veggie Skillet"],
      eaten: ["Ham Sandwich"],
      summary: "Veggie Skillet waste remains high in Q4.",
    },
  },
};

function RouteLineChart() {
  const [selectedRoute, setSelectedRoute] = useState("SEA-JFK");
  const [clickedQuarter, setClickedQuarter] = useState("");

  const handleQuarterClick = (data) => {
    setClickedQuarter(data.quarter);
  };

  const insights = routeQuarterlyInsights[selectedRoute]?.[clickedQuarter];

  return (
    <div>
      <h3 style={{ textAlign: "center" }}>Waste Trend - {selectedRoute}</h3>
      <div style={{ display: "flex", justifyContent: "flex-end", marginBottom: "0.5rem" }}>
        <select
          value={selectedRoute}
          onChange={(e) => {
            setSelectedRoute(e.target.value);
            setClickedQuarter(""); // Reset on route change
          }}
          style={{ padding: "0.3rem" }}
        >
          {Object.keys(routeQuarterlyData).map((route) => (
            <option key={route} value={route}>
              {route}
            </option>
          ))}
        </select>
      </div>

      <ResponsiveContainer width="100%" height={300}>
        <LineChart
          data={routeQuarterlyData[selectedRoute]}
          margin={{ top: 10, right: 30, left: 20, bottom: 30 }}
          onClick={({ activeLabel }) => {
            const dataPoint = routeQuarterlyData[selectedRoute].find((d) => d.quarter === activeLabel);
            if (dataPoint) {
              handleQuarterClick(dataPoint);
            }
          }}
        >
          <XAxis dataKey="quarter" label={{ value: "Quarter", position: "bottom", offset: 0 }} />
          <YAxis label={{ value: "Waste (g)", angle: -90, position: "insideLeft" }} />
          <Tooltip />
          <Legend />
          <Line type="monotone" dataKey="waste" stroke="#8884d8" activeDot={{ r: 8 }} name="waste" />
        </LineChart>
      </ResponsiveContainer>

      {insights && (
        <div
          style={{
            backgroundColor: "#f9f9f9",
            marginTop: "1rem",
            padding: "1rem",
            borderRadius: "8px",
            boxShadow: "0 0 4px rgba(0,0,0,0.1)",
          }}
        >
          <h4>ðŸ§¾ Waste Breakdown for {selectedRoute} - {clickedQuarter}</h4>
          <ul>
            <li><strong>Untouched:</strong> {insights.untouched.join(", ")}</li>
            <li><strong>Fully Eaten:</strong> {insights.eaten.join(", ")}</li>
          </ul>
          <p><strong>ðŸ’¡ Insight:</strong> {insights.summary}</p>
        </div>
      )}
    </div>
  );
}

export default RouteLineChart;
